export default {
  generateOP_Landscape_3Vertical() {
    const { jsPDF } = window.jspdf; 
		const TESDA_LOGO_BASE64 =
  "data:image/png;base64,"; 


    // LANDSCAPE MODE
    const doc = new jsPDF("l", "mm", "A4");

    const BLUE = [0, 51, 153]; // TESDA blue

    // PAGE SIZE (LANDSCAPE)
    const PAGE_WIDTH = 297;
    const PAGE_HEIGHT = 210;

    // OR LAYOUT
    const MARGIN_X = 4;
    const MARGIN_Y = 21;
    const GAP = 3;

    const OR_WIDTH = (94) ; //  91mm
    const OR_HEIGHT = (173);

    const data = GetApplicants.data.filter(r =>
      r.STATUS === "Paid" &&
      r.QUALIFICATION === ac_table.selectedRow.Q_CODE &&
      r["BATCH "] === Select_Batch.selectedOptionValue
    );

    if (!data.length) {
      showAlert("No records found", "warning");
      return;
    }

    const peso = "( _35.00_)";
    const amountWords = "______THIRTY-FIVE PESOS ONLY_____";

    data.forEach((r, i) => {
      const col = i % 3;
      if (i > 0 && col === 0) doc.addPage();

      const x = MARGIN_X + col * (OR_WIDTH + GAP);
      let y = MARGIN_Y;
			 // ================= BORDER =================
			doc.setDrawColor("BLACK");
			doc.setLineWidth(0.6);
      doc.rect(x, y, OR_WIDTH, OR_HEIGHT);

      y += 10;
			
      doc.setTextColor(...BLUE);
      doc.setDrawColor(...BLUE);
      doc.setLineWidth(0.2);

     

      // ================= HEADER =================
     // ===== TESDA LOGO =====
			doc.addImage(
  TESDA_LOGO_BASE64,
  "PNG",
  x + OR_WIDTH / 2 - 9, // center logo
  y - 4,
  18,
  18
);

y += 18;
// ===== TESDA TEXT =====
doc.setFont("helvetica", "bold");
doc.setFontSize(7);
doc.text("TESDA CAVITE", x + OR_WIDTH / 2, y, { align: "center" });

y += 3;
doc.setFontSize(7);
doc.setFont("helvetica", "normal");
doc.text("Agency", x + OR_WIDTH / 2, y, { align: "center" });

				y += 10;
      // Right header
      doc.setFontSize(5);
      doc.setFont("helvetica", "normal");
      doc.text("No: CAC 26-", x + OR_WIDTH - 13, y - 8, { align: "right" });
      doc.text("Date: ____________", x + OR_WIDTH - 4, y - 2, { align: "right" });
			doc.line(x + 70, y - 7, x + OR_WIDTH - 4, y -7);
			
      y += 8;
      doc.setFont("helvetica", "bold");
      doc.setFontSize(5);
      doc.text("ORDER OF PAYMENT", x + OR_WIDTH / 2, y, { align: "center" });
		
      y += 5;

      // ================= COLLECTING OFFICER =================
			doc.setFont("helvetica", "bold");
      doc.text("The Collecting Officer", x + 4, y,);
			doc.setFont("helvetica", "normal");
      doc.text("Cash Unit", x + 4, y + 2);

      y += 8;

      // ================= NAME =================
      doc.text("Please issue Official Receipt in favor of",x + OR_WIDTH / 2, y, { align: "center" });

      y += 5;
      doc.setFont("helvetica", "bold");
			doc.setTextColor("black");
      doc.setFontSize(10);
      doc.text(r.NAME.toUpperCase(), x + OR_WIDTH / 2, y, { align: "center" });

      doc.line(x + 4, y + 2, x + OR_WIDTH - 4, y + 2);

      y += 3.5;
      doc.setFontSize(5);
			doc.setTextColor(... BLUE);
      doc.setFont("helvetica", "normal");
      doc.text("(name)", x + OR_WIDTH / 2, y, { align: "center" });

      y += 5;
      doc.setFontSize(10);
			doc.setFont("helvetica", "bold");
			doc.setTextColor("black");
      doc.text("Adlas, Silang Cavite", x + OR_WIDTH / 2, y, { align: "center" });

      doc.line(x + 4, y + 2, x + OR_WIDTH - 4, y + 2);

      y += 3.5;
      doc.setFontSize(5);
			doc.setFont("helvetica", "normal");
			doc.setTextColor(... BLUE);
      doc.text("(address/office)", x + OR_WIDTH / 2, y, { align: "center" });

      y += 6;

      // ================= AMOUNT =================
      doc.setFontSize(7);
			doc.setTextColor(...BLUE);
      doc.text("In the amount of", x + 4, y);

      doc.setFont("helvetica", "bold");
			
			
			doc.setFontSize(10);
      doc.text(amountWords, x + OR_WIDTH -35, y, { align: "center" });
			doc.setFontSize(14);
      doc.text(peso, x + OR_WIDTH - 5, y+8, { align: "right" });

     
			doc.line(x + 5, y + 9, x + OR_WIDTH - 27, y + 9);

      y += 12;

      // ================= PAYMENT FOR =================
      doc.setFont("helvetica", "normal");
			doc.setFontSize(5);
			doc.setTextColor(... BLUE);
      doc.text("For payment of", x + 4, y+3);

      y += 7;
      doc.setFont("helvetica", "bold");
			doc.setTextColor("black");
      doc.setFontSize(15);
      doc.text(r.QUALIFICATION, x + OR_WIDTH / 2, y+2, { align: "center" });

      doc.line(x + 22, y - 3, x + OR_WIDTH - 4, y -3);
			doc.line(x + 4, y + 3, x + OR_WIDTH - 4, y + 3);
			doc.line(x + 4, y + 9, x + OR_WIDTH - 4, y + 9);

      y += 5.5;
      doc.setFontSize(5);
			doc.setTextColor(... BLUE);
      doc.setFont("helvetica", "normal");
      doc.text("(Qualification)", x + OR_WIDTH / 2, y+6, { align: "center" });

      y += 10;

      // ================= BILL =================
      doc.setFontSize(7);
      doc.text("Per Bill No.: N/A", x + 4, y);
      doc.text("Dated: N/A", x + 4, y + 4);

      y += 10;

      // ================= BANK =================
      doc.text("Please deposit the collections under Bank", x + 4, y);
      doc.text("Account/s:", x + 4, y + 4);

      y += 10;
      doc.text("NO.", x + 4, y);
      doc.text("Name of Bank", x + OR_WIDTH / 2, y, { align: "center" });
      doc.text("Amount", x + OR_WIDTH - 4, y, { align: "right" });

      doc.line(x + 4, y + 4, x + OR_WIDTH - 70, y + 4);
			 doc.line(x + 4, y + 8, x + OR_WIDTH - 70, y + 8);
			doc.line(x + 60, y + 4, x + OR_WIDTH - 60, y + 4);
			doc.line(x + 60, y + 8, x + OR_WIDTH - 60, y + 8);
      y += 7;
      doc.text("2052-1019-08", x + 4, y);
			doc.setFont("helvetica", "bold");
			doc.text("Total", x + 4, y+5);
			doc.setFontSize(10);
      doc.text(peso, x + OR_WIDTH - 4, y, { align: "right" });
			

      y += 15;

      // ================= SIGNATURE =================
      doc.line(x + 18, y, x + OR_WIDTH - 18, y);
      doc.setFont("helvetica", "bold");
      doc.setFontSize(5);
      doc.text("MARIA EVELYN F. BOSUTROS", x + OR_WIDTH / 2, y + 3, { align: "center" });

      doc.setFontSize(5);
      doc.setFont("helvetica", "normal");
      doc.text("FINANCIAL ANALYST", x + OR_WIDTH / 2, y + 6, { align: "center" });
    });

     return doc.output("datauristring");
  }
};
